Sort and Filter double nested mongo array<p>I have a database entry similar to the below:</p>
<pre><code>name: &quot;List 1&quot;
sections:[
        order:0
        name:&quot;section 1&quot;
            items : [Array
                visible:1
                name: &quot;Item 1&quot;
            ],
            visible:0
                name: &quot;Item 2&quot;
            ],

        order:0
        name:&quot;section 2&quot;
            items : [Array
                visible:1
                name: &quot;Item 1&quot;
            ],
            visible:1
                name: &quot;Item 2&quot;
            ]
            ...
</code></pre>
<p>I want to design a query in mongo that will let me</p>
<ol>
<li>Order the sections according to the <code>sections.order</code> key</li>
<li>Filter out any items that have items.<code>visible !=1</code>. So far I've found that I can use unwind like this to reorder the <code>sections</code>, what I can't seem to find out is how to prevent the <code>items</code> with <code>visible !-1</code> from ending up in the result</li>
</ol>
<p>Working Mongo Query to order the sections:</p>
<pre><code>Record.aggregate([
    { $match: { name:name } },
    { $unwind: &quot;$sections&quot; },

    { $sort: { &quot;sections.order&quot;: 1}, },
    {
      $group: {

        sections: { $push: &quot;$sections&quot; },
      },
    },
    {
      $project: {
        sections: &quot;$sections&quot;,
      },
    },
  ])
</code></pre>
<p>The above query will order the sections correctly but I still get items with <code>visible:0</code> in there. Do you know how to filter out those items?</p>

